import css from './category.css';
import refs from '../../refs/index.js';
import kitchen from './template/kitchen.hbs';
import embedded from './template/embedded.hbs';
import household from './template/household.hbs';
import home from './template/home.hbs';
import { createSale } from '../createCards/index.js'; // дома проверить
import store from '../../components/store';

function renderCategories() {
  function categoriesMarkup() {
    const markup = `<div class="category">
          <ul class="category-list list">
            <li class="category-list-item">
              <img
                src="data:image/jpeg;base64,"
                alt="Бытовая техника"
                width="100%"
              />
              <h2 class="category-title">Крупная бытовая техника</h2>
              <button name="household" class="category-link button primary">
                Купить
              </button>
            </li>
            <li class="category-list-item">
              <img
                src="data:image/jpeg;base64,"
                alt="Бытовая техника"
                width="100%"
              />
              <h2 class="category-title">Встраиваемая техника</h2>
              <button name="embedded" class="category-link button primary">
                Купить
              </button>
            </li>
            <li class="category-list-item">
              <img
                src="data:image/jpeg;base64,"
                alt="Бытовая техника"
                width="100%"
              />
              <h2 class="category-title">Уход за домом и одеждой</h2>
              <button name="home" class="category-link button primary">
                Купить
              </button>
            </li>
            <li class="category-list-item">
              <img
                src="data:image/jpeg;base64,"
                alt="Бытовая техника"
                width="100%"
              />
              <h2 class="category-title">
                Техника для кухни &#160; &#160;&#160;&#160;
              </h2>
              <button name="kitchen" class="category-link button primary">
                Купить
              </button>
            </li>
          </ul>
        </div>`;
    refs.mainContainer.insertAdjacentHTML('beforeend', markup);
  }
  categoriesMarkup();
  const cartClear = document.querySelector('.category');
  const categories = store.localCategories;

  cartClear.addEventListener('click', e => {
    e.preventDefault();

    if (e.target.name === 'household' || e.target.id === 'household') {
      //Крупная бытовая техника
      const cartClear = document.querySelector('.category');
      cartClear.innerHTML = '';
      house();
    }
    if (e.target.name === 'embedded' || e.target.id === 'embedded') {
      //Встраиваемая техника
      const cartClear = document.querySelector('.category');
      cartClear.innerHTML = '';
      embed();
    }
    if (e.target.name === 'home' || e.target.id === 'home') {
      //Уход за домом и одеждой
      const cartClear = document.querySelector('.category');
      cartClear.innerHTML = '';
      hom();
    }
    if (e.target.name === 'kitchen' || e.target.id === 'kitchen') {
      //Техника для кухни
      const cartClear = document.querySelector('.category');
      cartClear.innerHTML = '';
      kitche();
    }
  });

  function house() {
    //Крупная бытовая техника //kbt
    const item = household(categories[0].items);
    document.querySelector('.category').insertAdjacentHTML('beforeend', item);

    document.getElementById('cart-list').addEventListener('click', e => {
      createSale(e.target.textContent);
    });
  }
  function embed() {
    //Встраиваемая техника //it
    const item = embedded(categories[1].items);
    document.querySelector('.category').insertAdjacentHTML('beforeend', item);

    document.getElementById('cart-list').addEventListener('click', e => {
      createSale(e.target.textContent);
    });
  }
  function hom() {
    //Уход за домом и одеждой //home
    const item = home(categories[2].items);
    document.querySelector('.category').insertAdjacentHTML('beforeend', item);

    document.getElementById('cart-list').addEventListener('click', e => {
      createSale(e.target.textContent);
    });
  }
  function kitche() {
    //Техника для кухни //kitchen
    const item = kitchen(categories[3].items);
    document.querySelector('.category').insertAdjacentHTML('beforeend', item);

    document.getElementById('cart-list').addEventListener('click', e => {
      createSale(e.target.textContent);
    });
  }
}
export default renderCategories;
